  \"Feeding ecology of marine birds in the nearshore waters of Kodiak Island: Final
  report to the Outer Continental Shelf Environmental Assessment Program\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:28.434126\",\n\t\"name\": \"feeding-ecology-of-marine-birds-in-the-nearshore-waters-of-kodiak-island-final-report-to-t\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The feeding habits of marine birds in the
  nearshore waters of Kodiak Island were studied during winter 1976-1977 and February
  1978 and during summer 1977 and 1978. Our goals were to determine which prey were
  important to each species of bird and to define geographic, seasonal, and annual
  patterns of prey use. A total of 1,167 birds of 10 species were collected during
  the two year study. During both winters, oldsquaws and Steller's eiders ate a broad
  range of invertebrate prey, and common murres ate primarily gadids. Marbled murrelet
  feeding habits varied between the two winters; capelin were eaten in 1976-1977,
  but mysids were eaten during 1978. Pigeon guillemots and crested auklets were collected
  only during 1976-1977 when guillemots ate a broad range of epibenthic organisms,
  and auklets ate only mysids.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
